import React from 'react'
import "./categories.scss"
const Categories = () => {
  return (
    <>
        {CategoriesType.map((item, index) => 
            <div className="item" key={index}>
                <img src={item.img} alt="" />
                <div className="itemInfo"></div>
            </div>
        )}
    </>
  )
}

export default Categories
